import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import Home from "./components/Home";
import './App.css';

function App() {
  return (
    <div className="App">
        <BrowserRouter>
        <Routes>
          <Route exact path="/" element={<Home />} />
          <Route exact path="/new" element={<AddVoting/>} />
          <Route exact path="/:id" element={<View/>} />
          {/* <Route exact path="/edit/:id" element={<UpdateProject/>} /> */}
          <Route exact path="/signup" element={<Register />} />

        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
